module.exports = "<div class=\"container\">\n  <div class=\"row\">\n      <div class=\"row\">\n          <div class=\"col-4\">\n            <img src=\"data:image/jpeg;base64,\" alt=\"\">\n          </div>\n          <div class=\"col-8\">\n            <p class=\"parrafoInicial\">La independencia de argentina se consolido en el congreso de Tucumán en 1816. Para evitar caer bajo el dominio español se unieron y las provincias enviaron sus representantes al congreso. Alli se proclamó la independencia y se organizó el país en una república presidida por un directorio.\n\n                José de san Martin (1778 -1850) destacado militar argentino participo decisivamente  en la consolidación de la independencia de su país, se propuso cruzar los andes y devolver la independencia a chile. Para llevar a cabo su proyecto y aliarse al chileno Bernardo  O’Higgins (1778 -1842), que encabezaba la resistencia chilena, san Martin debía conseguir el apoyo de las provincias  del rio de la plata.</p>\n          </div>\n        </div>\n  </div>\n  <div class=\"row\">\n      <div class=\"col-8\">\n        <h2>Paises a los que el General San Martin Libero</h2>\n        <hr>\n        <h4>Liberacion de Chile</h4>\n        <p>Las fuerzas de Las Heras, O’Higgins y Soler se reunieron el 8 de febrero en el campamento de Curimón. Ante las noticias del avance del jefe realista, coronel Rafael Maroto, hacia las casas de Chacabuco, San Martín ordenó el avance. El 12 de febrero se libró la batalla de Chacabuco, en la que el Ejército de Los Andes obtuvo la victoria sobre los realistas, que plañieron 500 muertos y 600 prisioneros mientras que los patriotas tuvieron solo 12 bajas.La desmoralización hizo efecto en Santiago, y muchos patriotas escribieron a Osorio pidiendo clemencia, mientras otros huían a las Provincias Unidas. Pero San Martín no se dio por vencido, y en quince días puso nuevamente a su ejército en condiciones de luchar nuevamente y esperó a Osorio en los llanos del río Maipo.\n\nEl 5 de abril se produjo la batalla de Maipú, en que fuerzas patriotas obtuvieron una completa victoria. \n\nEl adversario dejó en el campo de batalla 2000 cadáveres, cerca de 2500 prisioneros, todo su armamento y material de guerra. El brigadier O’Higgins, herido en Cancha Rayada, no participó de la batalla; pero se hizo presente una vez finalizada la lucha, montado en su caballo, para abrazar a San Martín y llamarlo «Salvador de Chile»\nCon la batalla de Maipú se obtuvo definitivamente la victoria sobre las tropas realistas, lo que aseguró la independencia de Chile. El Gobierno de Chile lo premió con una vajilla de plata y 6000 pesos, pero San Martín rechazó ambos regalos diciendo: «No estamos en tiempos para tanto lujo».60​\n\nSin embargo, San Martín tuvo opositores locales, como los hermanos Carrera, líderes de un sector opositor a O’Higgins, que diferían de San Martín y O'Higgins. Juan José y Luis Carrera fueron arrestados en Mendoza, y José Miguel huyó a la Banda Oriental. Poco antes de conocerse el resultado de la batalla de Maipú, Juan José y Luis Carrera fueron fusilados en Mendoza por orden del gobernador Toribio de Luzuriaga, a instancias de Bernardo de Monteagudo,62​ que poco después volvió a Chile\n        ​</p>\n      </div>\n      <div class=\"col-4\">\n        <img src=\"data:image/jpeg;base64,\" alt=\"\">\n        <hr>\n        <img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/1/12/Jura_Independencia_Chile-Cosme_San_Mart%C3%ADn.jpg/300px-Jura_Independencia_Chile-Cosme_San_Mart%C3%ADn.jpg\" alt=\"\">\n      </div>\n  </div>\n  <div class=\"row\">\n      <div class=\"col-4\">\n        <img src=\"data:image/jpeg;base64,\" alt=\"\">\n      </div>\n      <div class=\"col-8\">\n        <h4 class=\"titulo1\">Independencia de Peru</h4>\n        <p class=\"parrafoInicial2\">\n            El 8 de septiembre de 1820, el ejército al mando de José de San Martín desembarcó en la playa de Paracas, cerca del puerto de Pisco, haciendo retroceder al ejército realista, que se replegó a la zona de la Sierra.\n            El virrey Pezuela tenía bajo su mando a unos 20 000 soldados, distribuidos por todo el virreinato, de los cuales la mayor parte defendía Lima.64​ Tratando de ganar tiempo para reunir a todos los soldados, planteó una salida diplomática al conflicto, reuniéndose los delegados de ambas partes en Miraflores (sur de Lima), que finalmente no llegaron a ningún acuerdo aceptable para San Martín. Este envió una división al mando del general Juan Antonio Álvarez de Arenales por la ruta de la sierra, para perseguir a las divisiones realistas ubicadas en esa zona y propiciar la insurrección de las poblaciones a lo largo de su trayecto.\n          </p>\n        </div>\n        <div>\n          <p>\n            San Martín se reembarcó en la escuadra, y en los primeros días de noviembre desembarcó en la localidad de Huacho, donde fortificó su posición e inició su estrategia para sitiar definitivamente Lima.El 29 de enero de 1821 se sublevaron altos oficiales realistas contra el virrey Pezuela, quien renunció a su cargo y fue sustituido por el general José de La Serna, que sería confirmado más tarde como virrey del Perú por la corona. El nuevo virrey propuso a San Martín nuevas negociaciones diplomáticas, que finalmente fracasaron debido a que la propuesta definitiva del general era la independencia del Perú. El sitio de Lima se prolongó por algunos meses; en el mes de marzo arribó al Perú el capitán Manuel Abreu, enviado por el rey de España como emisario pacificador, sin ninguna consecuencia favorable para los independentistas. San Martín decidió iniciar una nueva estrategia y envió dos ejércitos, uno al mando del general Guillermo Miller, para desembarcar en las costas del sur, y otra al mando del general Arenales, hacia la sierra.\n            San Martín dejó Huacho y desembarcó en Ancón, estrechando el cerco a Lima. En simultáneo inició nuevas negociaciones de paz, que se realizaron entre mayo y junio en la hacienda de Punchauca, cerca de Lima; los delegados de San Martín fueron Tomás Guido, Juan García del Río y José Ignacio de la Roza; por parte del virrey La Serna fueron Manuel Abreu, Manuel de Llano y José María Galdeano. Las negociaciones de nuevo fracasaron.64​\n\n            Pocos días después se pasó a sus filas uno de los más destacados regimientos de las fuerzas del virrey: el regimiento realista Numancia, compuesto de venezolanos y neogranadinos, que había sido formado en Venezuela en 1813 y enviada al Perú tres años más tarde en por Pablo Morillo. Esta deserción en masa desmoralizó al resto de las fuerzas realistas, lo que obligó a De La Serna a abandonar la ciudad el 5 de julio e internarse en la sierra. Esto le abrió las puertas de Lima a San Martín.\n          </p>\n        </div>\n\n        \n\n  </div>\n  <div class=\"row\">\n      <div class=\"col-4\">\n        <img class=\"imagen\" src=\"https://www.elhistoriador.com.ar/gaceta/2014/85/img/9_de_julio_min.jpg\" alt=\"\">\n        <h3>Un Fragmento del Pueblo en armas</h3>\n        <iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\"width=\"250\" height=\"200\" type=\"text/html\" src=\"https://www.youtube.com/embed/aqEDd6TRi6c?autoplay=0&fs=0&iv_load_policy=3&showinfo=0&rel=0&cc_load_policy=0&start=0&end=0&origin=https://youtubeembedcode.com\"></iframe>\n      </div>\n      <div class=\"col-8\">\n        <h4 class=\"titulo1\">Independencia Argentina por parte del Procer</h4>\n        <p class=\"parrafoInicial2\">Declarar la Independencia, Dictar una Constitución y Formar Gobierno.\n\n            Finalizado abruptamente el Directorio encabezado por el joven Carlos de Alvear, el Cabildo de Buenos Aires, ejerciendo nuevamente la potestad tutelar de la revolución que ostentó desde el mismo 22 de mayo de 1810, eligió como nuevo Director Supremo a José Rondeau en abril de 1815, pero como este último se encontraba al frente del Ejército del Norte en reemplazo de Coronel San Martín quien , por razones de salud solicitó su retiro a Córdoba para solicitar finalmente la Gobernación Intendencia de Cuyo; José Ignacio Alvares Thomas fue designado Director Interino cargo que ejerció desde ese momento hasta mayo de 1816 cuando fue reemplazado por Juan Martín de Pueyrredón.\n          </p>\n        </div>\n        <div class=\"col\">\n          <p>\n            A mediados de 1815 el Director Interino, en cumplimiento de lo dispuesto por el Estatuto Provisional sancionado en Mayo de 1815 el que en su artículo 30° establecía: luego que se posesione del mando, invitará, con particular esmero y eficacia, a todas las ciudades y villas de las provincias interiores para el pronto nombramiento de diputados que haya de formar la Constitución, los cuales deberán reunirse en Tucumán; convocó al esperado Congreso de las Provincias Unidas de Sudamérica. Recibida la comunicación, hacia fines de 1815 y principios de 1816 las provincias comenzaron la elección de diputados a razón de 1 cada 15.000 habitantes.\n            Gobernador de Cuyo\n            En 1814 el Director Supremo de las Provincias Unidas del Río de la Plata, Gervasio Antonio de Posadas, nombró a San Martín gobernador de la Intendencia de Cuyo, con sede en Mendoza. Para entonces, su plan ya estaba terminado y aprobado, y a partir de ese momento San Martín comenzó los preparativos para la campaña al Perú.52​\n          </p>\n        </div>\n  </div>\n</div>"

